const BASE_URL = "http://netrunner.life:4000";

const API = {
  EMAILSEND: `${BASE_URL}/email/send`,
  EMAILCHECK: `${BASE_URL}/email/check`,
  LOGOUT: `${BASE_URL}/auth/signout`,
  getProfileCardUrl: (userId) => `${BASE_URL}/auth/${userId}`,
};

export default API;
